      SELECT * FROM tab2 AS cor0 WHERE NOT col2 - - col0 / - 99 + + CAST ( - - col0 AS INTEGER ) + + 73 = - CAST ( col0 AS INTEGER ) * + + col2 * - - 53;
  - name: tab2

outputs:
